(6,'<p>Perhatikan gambar organ reproduksi pria di bawah ini!</p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"soal1(10).jpg\" style=\"width: 0px; height: 0px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"soal1(10).jpg\" style=\"width: 215.913px; height: 191px;\"></p><p>Organ nomor 5 berfungsi sebagai...</p><p><br></p><p><br></p>','2017-05-15 21:02:34'),
(7,'Organ reproduksi pada wanita yang berfungsi sebagai tempat terjadinya fertilisasi adalah...','2017-05-15 21:05:45'),
(8,'<p>Soni sudah melewati masa pubertas, namun dia belum mengalami perubahan suara maupun pertumbuhan rambut di berbagai bagian tubuhnya.</p><p>Menurut anda apa yang terjadi pada sistem reproduksi Soni?</p>','2017-05-15 21:11:31'),
(9,'<p>Berikut ini adalah gambar organ reproduksi wanita.</p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"images (1).jpg\" style=\"width: 288px;\"></p><p>Dimanakah tempat terjadinya pembentukan sel telur (ovum)?</p>','2017-05-15 21:26:27'),
(10,'<p>Seseorang yang hidupnya berganta-ganti pasangan diduga menderita penyakit menular seksual </p><p>sehingga dia memeriksakan dirinya ke rumah sakit.  Ia merasakan adanya daya tahan tubuh yang semakin menurun</p><p>dan mudah terinfeksi penyakit. Oleh dokter orang tersebut disarankan untuk tes darah. Kemungkinan penyakit yang diderita adalah...</p>','2017-05-15 21:34:49'),
(11,'<p>Perhatikan skema proses pembentukan spermatozoa di bawah ini.</p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"spermatogenesis.jpg\" style=\"width: 88.25px; height: 181.169px;\">&nbsp;</p><p>Tahap pembentukan spermatosit sekunder ditunjukan oleh nomor...</p>','2017-05-15 22:52:24'),
(12,'<p>Perhatikan nama bagian sistem reproduksi pada pria dibawah ini.</p><p>1) Testis&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;5) Uretra</p><p>2) Penis&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;6) Skrotum</p><p>3) Epididimis&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; 7) Vesikula seminalis</p><p>4) Vas deferens</p><p>Bagian sistem reproduksi di atas yang mempunyai tipe saluran adalah...&nbsp;</p>','2017-05-15 23:12:16'),
(13,'<p>Perbedaan spermatogenesis dan oogenesis yang keduanya merupakan proses</p><p>pembentukan sel gamet adalah...</p><p><br></p>','2017-05-15 23:20:13'),
(14,'<p>Dibagian ujung kepala sperma terdapat akrosom yang berfungsi...</p>','2017-05-15 23:32:56'),
(15,'<p>Seorang pria diketahui sebagian ususnya terdorong masuk ke daerah selangkangan. </p><p>Kelainan yang dialami pria tersebut adalah...</p>','2017-05-15 23:33:03'),
(16,'<p>Perhatikan gambar organ reproduksi wanita berikut.</p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"HYMEN.jpg\" style=\"width: 344px;\"></p><p>Jika terjadi pembuahan, akan terbentuk embrio yang akan mengalami pertumbuhan dan perkembangan pada organ yang ditunjukan oleh nomor...</p>','2017-05-16 00:02:39'),
(17,'<p>Sering kita menjumpai seorang ibu muda yang tidak memberikan ASI eksklusif untuk bayinya karena dituntut pekerjaan yang mengharuskan dia kembali bekerja tak berapa lama setelah melahirkan.</p><p>Apakah anda setuju dengan keputusan ibu muda tersebut?</p>','2017-05-16 00:23:54'),
(18,'<p>Perhatikan pernyataan di bawah ini.</p><p>1) Duduk bersebelahan dengan penderita</p><p>2) Transfusi darah yang terinfeksi penyakit menular seksual</p><p>3) Hubungan seks yang tidak aman</p><p>4) Penggunaan toilet yang bersamaan dengang penderita</p><p>5) Berjabat tangan dengan penderita</p><p>Pernyataan yang bukan merupakan cara penularan PMS adalah...</p>','2017-05-16 00:30:50'),
(19,'<p>Peristiwa peluruhan dinding uterus diikuti pendarahan yang dikeluarkan melalui vagina disebut...</p><p><br></p>','2017-05-16 00:36:38'),
(20,'<p>Sel-sel yang mengalami Meiosis I dalam tubulus seminiferus adalah...</p>','2017-05-16 00:41:04'),
(21,'<p><br></p><p><img src=\"data:image/png;base64,\" data-filename=\"image_thumb5.png\" style=\"width: 274.25px; height: 318.88px;\"></p><p>Berdasarkan grafik tersebut, kondisi yang terjadi pada fase proliferasi adalah...<br></p><p><br></p><div><br></div>','2017-05-16 23:23:47'),
(22,'<p>Kondisi ovarium pada saat fase ovulasi adalah...</p>','2017-05-16 23:33:18'),
(23,'<p>Salah satu metode kontrasepsi yang dikenal vasektomi, bagian saluran sperma diikat atau dipotong.</p><p>Kemungkinan yang terjadi setelah pembedahan ini adalah...</p>','2017-05-16 23:38:35'),
(24,'<div>Agar tidak tertular penyakit HIV/ AIDS</div><div>pencegahan apa yang dapat anda lakukan?</div><div><br></div>','2017-05-16 23:54:21'),
(25,'<p>Sebelum terbentuk ovum secara bertahap terjadi pembentukan sel kelamin</p><p>Lengkapi gambar dibawah ini!</p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"oogenesis.jpg\" style=\"width: 100.25px; height: 170.485px;\"></p><p><br></p>','2017-05-17 00:04:42'),
(26,'<p><p><span style=\"color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\">Berikut sel-sel yang terbentuk pada spermatogenesis:</span></p><span style=\"color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\">1. Spermatogonia</span><br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\"><span style=\"color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\">2. Spermatosit primer</span><br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\"><span style=\"color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\">3. Spermatosit sekunder</span><br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\"><span style=\"color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\">4. Spermatid</span><br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\"><span style=\"color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\">5. Spermatozoa</span></p><p><span style=\"color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\">Urutan pembentukan spermatozoa yang tepat adalah ...&nbsp;</span><span style=\"color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\"><br></span></p>','2017-05-17 00:16:37'),
(27,'<p style=\"text-align: left;\"><span style=\"color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\">Gametogenesis adalah peristiwa pembentukan gamet yang menghasilkan kromosom diploid.</span></p><p style=\"text-align: left;\">                                                                   <b> <span style=\"color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\">Sebab</span></b></p><p style=\"text-align: left;\"><span style=\"color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\">Dalam peristiwa gametogenesis terjadi pembelahan meiosis di dalam testis dan ovarium.</span><br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\"></p><p><br></p>','2017-05-17 00:25:29'),
(28,'<p><span style=\"color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\">Secara kimia atau hormonal ovulasi dapat dicegah dengan pemberian kombinasi estrogen dan progesteron dalam kadar yang tepat.</span></p><p>                                                                                              <b style=\"color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\">Sebab </b></p><div><span style=\"color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\">Estrogen dan progesteron dapat menghambat produksi FSH maupun LH oleh kelenjar hipofisis.</span><span style=\"color: rgb(68, 68, 68); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\"> </span></div>','2017-05-17 00:29:59'),
